Siouxsie &amp; the Banshees were a British rock band that formed in 1976. Led by the singer Siouxsie Sioux and the bassist Steven Severin, the band&amp;#039;s only constant members, the Banshees formed at the advent of the British punk scene and soon became one of the major bands in the post-punk era. Their music influenced a wide range of very diverse bands over the years amongst them The Cure, Massive Attack, Garbage and more recently LCD Soundsystem. The group released a total of eleven studio albums from 1978 to 1995.





